import React from 'react';
import { NavLink } from "react-router-dom";
import classes from './nagivation.module.css';

const Navigation = () => {
  return (
    <ul>
        <li>
          <NavLink to="tg" className={({ isActive }) => isActive ? classes.active : ''}></NavLink>
        </li>
    </ul>
  )
}

export default Navigation
